// PDF con la base de datos
var DataMaximCancel;
var diaEntrada;
var diaSortida;
var preu;
var estat;

//Formulario y  botón de reserva
$('#reservarButton').click(function() {
  //Valores de los campos del formulario
  const fromValue = $('#from-mod').val();
  const toValue = $('#to-mod').val();
  const emailValue = $('#rsv-email').val();

  // Crear un objeto de datos a enviar al servidor
  const data = {
      from: fromValue,
      to: toValue,
      'rsv-email': emailValue
  };

  //AJAX utilizando jQuery
  $.ajax({
      type: 'POST',
      url: '/index.php?r=doreserva',
      data: data, // Eliminar JSON.stringify(data)
      success: function(response) {
          diaEntrada = "Data d'inici: " + response.diaEntrada;
          diaSortida = "Data final: " + response.diaSortida;
          DataMaximCancel = "Data màxima per la cancel·lació: " + response.DataMaximCancel;
          estat = "Estat de la reserva: " + response.estat;
          preu = "Preu: " + response.preu;
          generatePDF(); // Llama a la función que genera el PDF con los datos dinámicos
          window.location.href = "/index.php";
      },
      error: function(error) {
          console.error('Error:', error);
      }
  });
});

    
window.jsPDF = window.jspdf.jsPDF;

function generatePDF() {
    // Se crea el objeto PDF
    var doc = new jsPDF();


 // LOGO en base64
 var logoBase64 =''
  //Fondo del pdf en negro
  doc.rect(0, 0, doc.internal.pageSize.width, doc.internal.pageSize.height, 'F');

  // Color de texto
  doc.setTextColor(255, 255, 255);
 //Css del pdf
  doc.addImage(logoBase64, 'PNG', 100, 10, 20, 20, { align: 'center' });
    doc.setFontSize(16); // Tamaño de fuente más grande para la cabecera
    doc.text('APARTAMENTS FIGUERENCS', 100, 50, { align: 'center' });

    // Título
    doc.setFontSize(12); // Restaurar el tamaño de fuente normal

    // Margen superior para los elementos
    var margenSuperiorElementos = 50;

    // Título "Dia Entrada" con margen superior
    doc.text(diaEntrada, 20, margenSuperiorElementos + 10);

    // Para hacer un salto de línea, aumenta el valor de 'y'
    var y = margenSuperiorElementos + 20;

    // Elemento "Dia Sortida" con margen superior
    doc.text(diaSortida, 20, y);

    
    y += 10;

    // Elemento "Cancelacio" con margen superior
    doc.text(DataMaximCancel, 20, y);

    
    y += 10;

    // Elemento "Estat" con margen superior
    doc.text(estat, 20, y);

    
    y += 10;

    // Elemento "Preu" con margen superior
    var precioConSimbolo = preu + ' €';
    doc.text(precioConSimbolo, 20, y);

    // Margen inferior en el pie de página
    var margenInferiorPieDePagina = 20;

    var mensaje = '¡Que vagi bé!';
    var xMensaje = doc.internal.pageSize.width / 2 - doc.getStringUnitWidth(mensaje) * doc.internal.getFontSize() / 2 + 20; // Ajusta el valor según sea necesario
    var yMensaje = y + 10; // Ajusta el valor según sea necesario
    doc.text(mensaje, xMensaje, yMensaje);


    // Se guarda el PDF
    doc.save('Reserva.pdf');
  }